import React from 'react';
import { motion } from 'framer-motion';
import { CheckCircle, TrendingUp, Users, Award } from 'lucide-react';

const WhyRankly360 = () => {
  const reasons = [
    {
      icon: <TrendingUp className="w-8 h-8" />,
      title: "Proven Results",
      description: "We've helped hundreds of local businesses dominate their markets and increase leads by 300%+"
    },
    {
      icon: <Users className="w-8 h-8" />,
      title: "Local Experts",
      description: "We specialize exclusively in local SEO and Google Maps optimization - it's all we do"
    },
    {
      icon: <Award className="w-8 h-8" />,
      title: "No Contracts",
      description: "Stay because you love the results, not because you're locked in. Cancel anytime"
    }
  ];

  const fadeInUp = {
    initial: { opacity: 0, y: 30 },
    whileInView: { opacity: 1, y: 0 },
    transition: { duration: 0.6 }
  };

  return (
    <section id="why-us" className="relative py-20 bg-gradient-to-b from-[#0f0f1a] to-[#09090f] overflow-hidden">
      {/* Space background effects */}
      <div className="absolute inset-0">
        <div className="absolute top-24 left-1/3 w-1 h-1 bg-[#3abef9]/40 rounded-full blur-[1px]" />
        <div className="absolute top-48 right-1/4 w-0.5 h-0.5 bg-white/30 rounded-full blur-[0.8px]" />
        <div className="absolute bottom-36 left-1/5 w-1.5 h-1.5 bg-[#00ffff]/50 rounded-full blur-[1.2px]" />
        <div className="absolute bottom-24 right-1/5 w-0.8 h-0.8 bg-[#3abef9]/35 rounded-full blur-[1px]" />
      </div>

      <div className="container mx-auto px-4 relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-6 bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent">
            Why Choose Rankly360?
          </h2>
          <p className="text-xl text-[#9ca3af] max-w-3xl mx-auto">
            We're not your typical SEO agency. We focus on one thing: getting your business to the top of Google Maps.
          </p>
        </motion.div>

        <div className="grid md:grid-cols-3 gap-8 mb-16">
          {reasons.map((reason, index) => (
            <motion.div
              key={index}
              {...fadeInUp}
              transition={{ delay: index * 0.1 }}
              className="bg-gradient-to-br from-[#10111a] to-[#0a0a0f] p-8 rounded-2xl border border-[#3abef9]/20 hover:border-[#3abef9]/40 transition-all duration-300 hover:shadow-[0_0_32px_0_rgba(58,190,249,0.15)] text-center"
            >
              <div className="w-16 h-16 bg-gradient-to-r from-[#3abef9]/20 to-[#007bff]/20 rounded-full flex items-center justify-center mx-auto mb-6 border border-[#3abef9]/30">
                <div className="text-[#3abef9]">
                  {reason.icon}
                </div>
              </div>
              <h3 className="text-xl font-bold text-white mb-4">
                {reason.title}
              </h3>
              <p className="text-[#9ca3af] leading-relaxed">
                {reason.description}
              </p>
            </motion.div>
          ))}
        </div>

        {/* Stats Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.3 }}
          className="bg-gradient-to-r from-[#3abef9]/10 to-[#007bff]/10 p-8 rounded-2xl border border-[#3abef9]/30"
        >
          <div className="grid grid-cols-2 md:grid-cols-4 gap-8 text-center">
            <div>
              <div className="text-3xl md:text-4xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent mb-2">
                300%+
              </div>
              <div className="text-[#9ca3af] text-sm">
                Average Lead Increase
              </div>
            </div>
            <div>
              <div className="text-3xl md:text-4xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent mb-2">
                500+
              </div>
              <div className="text-[#9ca3af] text-sm">
                Businesses Helped
              </div>
            </div>
            <div>
              <div className="text-3xl md:text-4xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent mb-2">
                30 Days
              </div>
              <div className="text-[#9ca3af] text-sm">
                Results Guarantee
              </div>
            </div>
            <div>
              <div className="text-3xl md:text-4xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent mb-2">
                0%
              </div>
              <div className="text-[#9ca3af] text-sm">
                Setup Fees
              </div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default WhyRankly360;
